import React from "react";
import "../index.css";
import photograph from "../assets/625825fb1ab402001927acdf-removebg-preview.png"

// components
import Navbar from "../Components/navbarComponent";
// import Booking from "../Components/bookUsComponent";

// css
import "../assets/css/homebg.css";

// home page
function Home() {
  return (
    <div className="background">
      <div className="container-fluid">
      <div className="row">
        <Navbar/>
        <div className="col-md-6 mt-5">
        <img style={{backgroundSize:'cover',backgroundPosition: "center", backgroundRepeat: "no-repeat"}}
            src={photograph}
            alt="Background"
            height="auto%"
            width="100%"
          />
        </div>
        <div className="col-md-6 my-5">
          <h1>“If the photographer is interested in the people in front of his lens,
             and if he is compassionate, it’s already a lot. 
             The instrument is not the camera but the photographer.”</h1>
        </div>
      </div>
    </div>

    </div>

  );
}

export default Home;
